        </TabList>
        <TabPanels>
          <TabPanel>
            <PlayerList forwards={[]} backs={[]} coaches={[]}></PlayerList>
          </TabPanel>
          <TabPanel>
            <PlayerList forwards={[]} backs={[]} coaches={[]}></PlayerList>
          </TabPanel>
        </TabPanels>
      </Tabs>
    </Layout>
  );
};

export default Team;
